///
///
///
//////GLOBAL DARKMODE HEIGHT  DATA
const initialState = {
  username: "",
  image: "",
  firstName: "",
  surName: "",
  color: "",
  quote: "",
  ////For example const initialState = { person: null as Person };
};
type MyUserdataReducer = typeof initialState;

//////GLOBAL DARKMODE HEIGHT REDUCER
export const UserdataReducer = (
  state = initialState,
  action: any
): MyUserdataReducer => {
  switch (action.type) {
    case UPDATE_SCREEN_HEIGHT:
      return { ...state, screenHeight: action.payload };
    default:
      return state;
  }
};
